import React, { useState } from 'react';

const App = () => {
  const [date, setDate] = useState('');
  const [text, setText] = useState('');
  const [selection, setSelection] = useState('');
  const [uploads, setUploads] = useState([]);

  const handleDateChange = (event) => {
    setDate(event.target.value);
  };

  const handleTextChange = (event) => {
    setText(event.target.value);
  };

  const handleSelectionChange = (event) => {
    setSelection(event.target.value);
  };

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    const newUpload = {
      file,
      date: new Date().toLocaleString()
    };
    setUploads([...uploads, newUpload]);
  };

  const handleFileOpen = (file) => {
    const fileURL = URL.createObjectURL(file);
    window.open(fileURL);
  };

  return (
    <div>
      <h1>Land Team Site Visit</h1>

      <h2>Last Uploads</h2>
      <input type="date" value={date} onChange={handleDateChange} />

      <h2>Land Evaluation Checklist</h2>
      <input type="text" value={text} onChange={handleTextChange} />

      <h2>Dropdown Selection</h2>
      <select value={selection} onChange={handleSelectionChange}>
        <option value="">Select an option</option>
        <option value="Option 1">Option 1</option>
        <option value="Option 2">Option 2</option>
        <option value="Option 3">Option 3</option>
      </select>

      <h2>File Upload</h2>
      <input type="file" onChange={handleFileUpload} />

      <h2>Uploaded Files</h2>
      <table>
        <thead>
          <tr>
            <th>File Name</th>
            <th>Date/Time Uploaded</th>
            <th>Open File</th>
          </tr>
        </thead>
        <tbody>
          {uploads.map((upload, index) => (
            <tr key={index}>
              <td>{upload.file.name}</td>
              <td>{upload.date}</td>
              <td>
                <button onClick={() => handleFileOpen(upload.file)}>Open</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
